import React from 'react';



const ViewAllPosts = (props) => {
  const allitems = props.allitems

  return (
    <ul>
      {
      allitems.map((singleItem, i) => {
        return <li key={i}>{singleItem.title}</li>;
      })}
    </ul>
  );
};

export default ViewAllPosts
